import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faWrench, faPlane, faGlobe, faArrowDown } from '@fortawesome/free-solid-svg-icons';
import './styles.css'; // Make sure to import the CSS file

const Home3 = () => {
  return (
    <div id="features2" style={{ display: 'flex', justifyContent: 'space-around', alignItems: 'center', padding: '20px 0' }}>
      <div className="icon-container">
        <FontAwesomeIcon icon={faSearch} className="icon-style" />
        <div>Recruitment</div>
      </div>
      <div className="icon-container">
        <FontAwesomeIcon icon={faWrench} className="icon-style" />
        <div>Maintenance</div>
      </div>
      <div className="icon-container">
        <FontAwesomeIcon icon={faPlane} className="icon-style" />
        <div>Ticketing</div>
      </div>
      <div className="icon-container">
        <FontAwesomeIcon icon={faGlobe} className="icon-style" />
        <h3>Hajj & Umrah</h3>
      </div>
      <div className="icon-container">
        <FontAwesomeIcon icon={faArrowDown} className="icon-style" />
        <div>Import & Export</div>
      </div>
    </div>
  );
};

export default Home3;
